import { Box } from "@gluestack-ui/themed";
import {
  VStack,
  HStack,
  Avatar,
  AvatarBadge,
  AvatarFallbackText,
  AvatarImage,
  Heading,
  Text,
  ScrollView,
} from "@gluestack-ui/themed";
import React from "react";
import { View } from "react-native";

const Home = () => {
  return (
    <View>
      <ScrollView>
        <Box marginTop={'10%'} alignSelf="center">
          <VStack>
            <HStack space="2xl">
              <Avatar size="2xl" bgColor="$indigo600">
                <AvatarFallbackText>Daniel Pineda</AvatarFallbackText>
              </Avatar>
              <VStack>
                <Heading size="2xl" >Daniel Pineda</Heading>
                <Text size="2xl">Bienvenido</Text>
              </VStack>
            </HStack>
          </VStack>

          <VStack>
            <HStack alignSelf="center" marginTop={'2%'}>
              <Heading size="2xl">Bienvenido</Heading>
            </HStack>
          </VStack>
        </Box>
      </ScrollView>
    </View>
  );
};

export default Home;
